 const _20190521EstIlEnVie = "{\"parsed\":{\"_path\":\"/blog/2019-05-21-est-il-en-vie\",\"_dir\":\"blog\",\"_draft\":false,\"_partial\":false,\"_locale\":\"\",\"title\":\"Est-il en vie ?\",\"description\":\"Ça fait (très) longtemps que je n'ai écrit d'article par ici… pourquoi ?\\nNe me demandez pas j'en sais rien…\",\"date\":\"2019-05-21T11:35:28.000Z\",\"author\":\"MarvinL\",\"layout\":\"post\",\"permalink\":\"est-il-en-vie\",\"image\":\"/pictures//2019/05/frank-park-39270-unsplash.jpg\",\"draft\":false,\"categories\":[\"JauneVie\"],\"body\":{\"type\":\"root\",\"children\":[{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Ça fait \"},{\"type\":\"element\",\"tag\":\"em\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"(très)\"}]},{\"type\":\"text\",\"value\":\" longtemps que je n'ai écrit d'article par ici… pourquoi ?\\nNe me demandez pas j'en sais rien…\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Je pourrais trouver tout type d'excuse, par exemple, que maintenant je fais des podcasts, et même des vidéos du coup j'ai plus rien à écrire… Ou que j'ai pas assez de temps ou que j'ai trop de boulot et tout ceci serait surement vrai.\"},{\"type\":\"element\",\"tag\":\"br\",\"props\":{},\"children\":[]},{\"type\":\"text\",\"value\":\"\\nSi je préfère écrire tout ceci c'est qu'en réalité la vérité est bien plus compliquée.\\nOu alors est-elle plus simple ? Je n'en avais pas l'envie \"},{\"type\":\"element\",\"tag\":\"em\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"(tout simplement)\"}]},{\"type\":\"text\",\"value\":\".\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Cette envie vient de me revenir et je ne saurais pas non plus vous expliquer pourquoi je veux partager ceci par écrit plutôt qu'en audio ou en vidéo.\\nLe fait de ne pas avoir a attendre d'être sur un ordi décent ou de devoir prendre du temps  pour faire le montage doit participer a tout cela.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"C'est une petite phase difficile qui me traverse en ce moment. Je crois que je paie le fait de ne pas avoir pris le temps pour moi, pour faire la transition post démission et d'avoir enchainé tout de suite sans repos, ou remise en question.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"J'ai été un peu malmené, retrouver ses marques dans sa gestion, tout en s'adaptant à un nouveau mode de fonctionnement, nouveau client, nouveau type de contrat, nouveaux projets, collaborateurs, lieu de travail… bref tout change.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"L'impression d'être submergée m'a rapidement rattrapé, elle m'a fait m'interroger sur ma façon de gérer mes taches et mes projets. Les priorités, le fait que je pense comme un salarié alors que je suis a nouveau freelance…\\nJe n'ai pas fait cette transition.  Pas correctement, pas jusqu'au bout.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Je crois que la lune, en plus du déménagement, des détours alimentaires n'arrangent rien à tout ça. Je suis content de m'en rendre compte et d'en avoir pleine conscience en tout cas. Ça me permet de pouvoir y apporter solution, ou du moins pistes d'améliorations.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Pour ceux qui ont lu jusque la dites vous que je n'avais a la base que la première phrase en tête quand j'ai commencé a écrire cet article, je me suis dit tiens ce serait une piste intéressante a développer… et me voila un long pavé plus tard.\\nJe ne relirai pas, je vais juste copier coller, agencer promptement pour que ce soit un minimum digeste et le lancer sur l'internet qu'on apprécie tant.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Advienne que pourra. Mektoub, carpe diem, sa ki fèt fèt.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"BOUDOUM.\"}]}],\"toc\":{\"title\":\"\",\"searchDepth\":2,\"depth\":2,\"links\":[]}},\"_type\":\"markdown\",\"_id\":\"content:blog:2019-05-21-est-il-en-vie.md\",\"_source\":\"content\",\"_file\":\"blog/2019-05-21-est-il-en-vie.md\",\"_stem\":\"blog/2019-05-21-est-il-en-vie\",\"_extension\":\"md\"},\"hash\":\"v7mPX4RTEf\"}";

